import React, { useState, useEffect } from 'react';
import axios from 'axios';

const App = () => {
	const [superheroes, setSuperheroes] = useState({});

	useEffect(() => {
		(async () => {
			const { data } = await axios.get(`http://localhost:3001/`);
			console.log(data);
		})();
	}, []);

	return <div>Hello World</div>;
};

export default App;
